It`s important to behave professionally at the office. If you`re a lusty  lesbian, though, that`s sometimes easier said than done. Devious  corporate climber Michelle Lay has a plan get on boss Kylie Ireland`s  good side, but it requires the cooperation of love-struck young Elexis.  Meanwhile, Kylie has her own plans for sympathetic roommate Mia Presley,  while Michelle relies on hot lover India Summer to confess what she  know about Kylie. Lust, deception and head games abound in this tale of  ambitious lesbians who know their way around the boardroom and the  bedroom.

Elexis Monroe, India Summer, Kylie Ireland, Mia Presley, Michelle Lay, Sinn Sage
